import React from 'react'
import SwordImage from './Images/sword.png'

function Sword(props) {
    return (
        <img src= {SwordImage}
        style= {{height: props.height,
            position: 'absolute',
            top: props.yPos,
            left: props.xPos,
            transform: 'rotate(100%)',
            transformOrigin: '(0,0)'}}/>
    )
}

export default Sword
